              </div>
              <div className="field-wrapper">
                <label>Email</label>
                <input type="email" placeholder="Enter Email id" />
                <img src={filled} alt="" />
              </div>
              <div className="">
                <button
                  className="button w-96 op-btn-primary mb-3"
                  onClick={() =>
                    this.props.history.push('email-send-successfully')
